import { ComponentProps, FC } from "react";
import { Input } from "reactstrap";
import Topics from "../AboutMe/Topics";
import Header from "../Header";
import MyProjects from "../Work/MyProjects";
import ProjectHeader from "./ProjectHeader";

interface Props {
  id?: number;
  picture: string;
  role: string;
  title: string;
  subtitle: string;
  description: string;
  topic1?: ComponentProps<typeof Input>["topics"];
  topic2?: ComponentProps<typeof Input>["topics"];
  topic3?: ComponentProps<typeof Input>["topic3"];
  topic4?: ComponentProps<typeof Input>["topic4"];
  topic5?: ComponentProps<typeof Input>["topic5"];
  topic6?: ComponentProps<typeof Input>["topic6"];
}

const ProjectDetails: FC<Props> = ({
  picture,
  children,
  role,
  title,
  subtitle,
  description,
}) => {
  return (
    <div className="projectdetails">
      <Header />
      <div className="projectdetails__content">
        a
        {projects.map((data, key) => {
          if (data.id === id) {
            {
              data.topics.map((item) => (
                <>
                  <Topics title={item.title}>
                    <p>{item.content}</p>
                  </Topics>
                </>
              ));
            }
          }
        })}
        <ProjectHeader
          role={role}
          title={title}
          subtitle={subtitle}
          description={description}
        />
        <img src={picture} alt="" />
        <div className="projectdetails__topics ">
          <Topics title={"Date"}>
            <p>May - Juin 2021</p>
          </Topics>
          <Topics title={"Role"}>
            <p>UI/UX designer</p>
          </Topics>
          <Topics title={"Agency"}>
            <p>Medicol SAS</p>
          </Topics>
          <Topics title={"Deliverables"}>
            <p>
              Mobile UI kit, customizable components, pre-made layouts, figma
              source file.
            </p>
          </Topics>
        </div>
        <div className="projectdetails__contentdetails">{children}</div>
      </div>
      <MyProjects />
    </div>
  );
};

export default ProjectDetails;
